import React from 'react';

function Contact() {
  return (
    <section id="contact">
      <h2>Contact</h2>
      <p>06-33-73-18-03</p>
      <p>barbosamathias.pro@gmail.com</p>
      <a href="https://www.linkedin.com/in/mathias-barbosa-b70801220">LinkedIn</a>
      <br></br>
      <a href="https://www.github.com/Fyoken">GitHub</a>
    </section>
  );
}

export default Contact;
